import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './components/css/global.css';
import { CitationProvider } from './components/context/CitationContext';

//j'ai pas utiliser le folder pages car j'ai une seul page 

function App() {
  return (
    <div>
<CitationProvider>
      <BtnsCitations/>
      <CreateSearch/>
      <Edit />
      <ToastContainer />
      <FavoriteCitation/>
</CitationProvider>
    </div>
  );
} 

export default App;
